import React, { Component } from 'react'
import cars from './cars.json'


export class Audi extends Component {




    render() {
        return (
            <div>
                {cars.map((carDet , index )=>{
                    return(
                        <div>
                            <h1>{carDet.Cars.Audi[0].name}</h1>
                        </div>
                )
                })}
            </div>
        )
    }
}

export default Audi
